import React, { useState, useEffect } from "react";

const API_URL = "https://fsra-chatbot-backend.onrender.com"; // Backend URL

function App() {
  // User Authentication States
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [user, setUser] = useState(null);

  // Chatbot States
  const [query, setQuery] = useState("");
  const [chatResponse, setChatResponse] = useState("");

  // Simulated User Data (Replace this with actual API authentication logic)
  useEffect(() => {
    // Simulating an API fetching user details after login
    const fakeUser = {
      name: "Gwyneth Gonzales", // Replace with dynamic data if available
      role: "FSRA Agent" // Replace with actual user role
    };
    setUser(fakeUser);
  }, []);

  // Function to handle user login
  const handleLogin = () => {
    if (email && password) {
      // Simulating a login, replace with real auth API call if needed
      setUser({ name: "Gwyneth Gonzales", role: "FSRA Agent" });
    }
  };

  // Function to handle chatbot query
  const handleChatbotQuery = async () => {
    if (!query.trim()) return;

    try {
      const response = await fetch(`${API_URL}/chat`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ message: query })
      });
      const data = await response.json();
      setChatResponse(data.reply);
    } catch (error) {
      console.error("AI Chatbot Error:", error.message);
    }
  };

  return (
    <div style={containerStyle}>
      {/* ✅ LOGIN SECTION */}
      {!user ? (
        <div style={loginContainerStyle}>
          <h2>Login</h2>
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={inputStyle}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={inputStyle}
          />
          <button onClick={handleLogin} style={buttonStyle}>Login</button>
        </div>
      ) : (
        <>
          {/* ✅ USER INFO SECTION */}
          <div style={headerStyle}>
            <h1>Insura</h1>
            <p><strong>Welcome, {user.name}</strong></p>
            <p><strong>Role:</strong> {user.role}</p>
            <button onClick={() => setUser(null)} style={buttonStyle}>Logout</button>
          </div>

          {/* ✅ CHATBOT SECTION */}
          <div style={chatbotContainerStyle}>
            <h3>AI Chatbot (FSRA Policy Assistant)</h3>
            <textarea
              placeholder="Ask a policy-related question..."
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              style={textareaStyle}
            />
            <button onClick={handleChatbotQuery} style={buttonStyle}>Ask AI</button>
            {chatResponse && <p><strong>AI Response:</strong> {chatResponse}</p>}
          </div>
        </>
      )}
    </div>
  );
}

/** ✅ STYLING **/
const containerStyle = {
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
  height: "100vh",
  backgroundColor: "#f8f9fa",
  fontFamily: "Arial, sans-serif"
};

const loginContainerStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "10px",
  backgroundColor: "#ffffff",
  padding: "20px",
  borderRadius: "8px",
  boxShadow: "0px 4px 6px rgba(0,0,0,0.1)"
};

const headerStyle = {
  textAlign: "center",
  marginBottom: "20px"
};

const chatbotContainerStyle = {
  width: "50%",
  backgroundColor: "#ffffff",
  padding: "20px",
  borderRadius: "8px",
  boxShadow: "0px 4px 6px rgba(0,0,0,0.1)",
  textAlign: "center"
};

const inputStyle = {
  padding: "10px",
  width: "250px",
  marginBottom: "10px",
  borderRadius: "5px",
  border: "1px solid #ccc"
};

const textareaStyle = {
  width: "100%",
  height: "80px",
  padding: "10px",
  borderRadius: "5px",
  border: "1px solid #ccc",
  marginBottom: "10px"
};

const buttonStyle = {
  padding: "10px 15px",
  backgroundColor: "#007bff",
  color: "#fff",
  border: "none",
  borderRadius: "5px",
  cursor: "pointer"
};

export default App;
